import React from "react";
import { Card } from "react-bootstrap";

const ProyectosPersonales = (props) => (
  <Card
    style={{ width: "30rem", margin: "10px" }}
    className="d-flex flex-row "
  >
    <Card.Body>
      <Card.Title className="m-3 d-flex justify-content-center items-center h2 small">
        {props.titulo}
      </Card.Title>
      <Card.Text style={{ fontSize: "20px", margin: "5px" }}>
        {props.descripcion}
      </Card.Text>
    </Card.Body>
    <Card.Img
      variant="top"
      src={props.imagenUrl}
      style={{ width: "20rem", marginTop: "7px" }}
    />
    
  </Card>
);

export default ProyectosPersonales;
